import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for links to be present
    await page.waitForSelector('a', { timeout: 5000 });

    // Use page.evaluate to scrape all links in one go for efficiency
    const exfiltratedLinks = await page.evaluate(() => {
      const links = [];
      document.querySelectorAll('a').forEach(anchor => {
        const text = anchor.textContent.trim();
        const href = anchor.getAttribute('href');
        if (text) { // Only include links with text content
          links.push({ text, href });
        }
      });
      return links;
    });

    // Take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_scraped.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_scraped.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all link text and href attributes from the page.",
      extractedData: {
        totalLinksFound: exfiltratedLinks.length,
        links: exfiltratedLinks
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
